  max-width: 1200px;
  margin: 0 auto;

  width: 100%;
  padding: 0 15px;
}

li {
  list-style-type: none;
 }

 h2 {
  font-size: $text-big;
 }
 
 h3 {
  font-size: $text-regular;
}

.under__title {
