    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
  }
  .title {
    text-align: center;
  }

  .intro span::after {
    left: 150px;
  }
  
  .partner {
    margin-top: 315px;
  }

  .information__inner, .service__inner {
    flex-direction: column;
    text-align: center;
  }

  .content {
    margin-left: 100px;
