    margin-left: 15px;
  }
  
  hr {
    width: 100px;
  }

  .article__inner {
    text-align: center;
  }

  .article__content {
    margin-top: 20px;
    margin-right: 150px;
  }

  .article__items, .footer__inner {
    display: flex;
    flex-direction: column;
  }

  .article__item:not(:last-child) {
    margin-bottom: 50px;
  }

  .offer__button {
    margin-top: 15px;
  }

  .footer__inner {
    text-align: center;
  }

  .footer__items {
    margin-top: 15px;
    width: 100%;
    display: flex;
    justify-content: space-around;
